import React from 'react';
import classes from './Player.module.css'
const player = (props) => {
    return (
        <div className={classes.player}>
            <p className={classes.name}>{props.name}</p>
            <img src={props.srcAvatar} alt="Avatar" className="avatar" />
            <div >
                <img  className={classes.icon} src={require('/Temporary Work/Project/react-vietnamese-poker/src/Player/poker.svg')} alt="Bet" />
                {props.bet}
            </div>
            <div>
                <img className={classes.icon} src={require('/Temporary Work/Project/react-vietnamese-poker/src/Player/gaming.svg')} alt="Cards" />
                {props.card}
            </div>
            <div className="score">{props.scrore}</div>
        </div>
    )
}

export default player;
